 Vladimir L. bromea preguntando si Henry Cucalón crece en peso o talla, jugando con la idea de su creciente relevancia política en las elecciones presidenciales de Ecuador 2025. Aunque Cucalón no llegó al balotaje, su influencia parece aumentar entre los debates de Noboa y González. Un giro sarcástico en un hilo serio.
